INSERT INTO `exam_questions` VALUES (1,'2022-09-05 11:39:27','2023-05-18 01:38:53',1,'R22018','題組一','Person A\nI work as a video game designer, and a quiet workspace is essential when I create stories and characters. Therefore, I definitely prefer closed office space where distractions are fewer. I won’t have to worry if someone would show up out of nowhere, wishing to speak with me but ending up interrupting my work. In fact, this is the main reason that I asked to transfer to my current office. I used to work in the main office which has a completely open space without walls. After realizing how it affected my concentration level and productivity, I applied for the transfer to a closed office space and couldn’t be happier with my decision.\n\nPerson B\nMy business partners and I knew that we needed an open office space when we started the company two years ago. For one thing, we wanted to stay more connected with our staff and to make ourselves available for communication. Another reason is we believed that removing physical barriers in the office space would encourage employees to collaborate; they would be more open to exchange ideas and ask for assistance. Looking back, I think we’ve made the right decision because we have had many brilliant product ideas resulted from brainstorming sessions and informal group conversations in this open space. \n\nPerson C\nMany people look at the choice between open or closed office space from the perspective of teamwork or productivity, but I have a different concern. I think closed office space is healthier for employees, both physically and emotionally. On the one hand, closed office space helps keep germs from fast spreading and therefore provides employees with increased physical health safety. On the other hand, closed office space improves employees’ emotional wellbeing by reducing their stress levels since there’s no need to appear in constant productivity.\n\nPerson D\nI don’t have personal preference for office space, but I can understand why our boss wanted to remove the walls. To begin with, open office space seems significantly cost-effective in terms of set-up and operation. No individual desks or other office equipment need to be purchased, and air conditioning and cleaning the space are more efficient. Also, without walls, the office space can easily be redesigned as required. This is especially important for a growing company like us, because the teams would still have space when expanding without feeling that the office becomes overcrowded too quickly.',99),(2,'2022-09-13 14:39:26','2022-10-11 00:25:15',1,'R22019','題組二','Online shopping\nPerson A\nI think the biggest benefit of online shopping is its convenience. There are basically no business hours in the digital space, which means it\'s easy to fit online shopping into my busy schedule. As a nurse, I often have different work shifts. With online shopping, I don\'t have to plan my purchases based on when a real store is open. I can also buy anything I want from the comfort of my home without having to go out or travel long distance. Online stores can be accessible from almost anywhere with internet access. \nPerson B\nI am not comfortable about shopping online because of the growing number of criminals who pretend to be legal sellers. For example, some criminals create fake websites or fake ads to steal shoppers’ credit card or bank account information. The problem gets even worse on social media where not only fake ads but fake products are also common. Although it’s easy to report online shopping crimes to the authorities, the shopping experiences can still be too unpleasant to bear. \nPerson C\nI prefer getting what I want immediately when shopping, but online sellers often force shoppers to wait days or longer for the order to arrive. Online purchases also cost more. To begin with, shoppers are generally required to make a minimum purchase to qualify for free shipping, which often means buying more than needed. In addition, many online stores or sellers use digital strategies such as ‘limited time’ sales pop-up messages to convince shoppers to buy more. Moreover, if shoppers are not satisfied with their purchases, they will be charged for shipping when returning the products.\nPerson D\nI shop online more often now because I like to find details about a product before making a purchase. In the past, I usually had to speak to store clerks in person for detailed product descriptions, which can be time-consuming sometimes. But now, all those can be done in just a few clicks. I can also access to reviews from other shoppers to help me make a more informed purchasing decision. In addition, because products in the digital space are not limited to shelves, I can enjoy a wider selection of products.',99),(3,'2023-04-27 11:16:37',NULL,2,'R23023','0428驗收用','0428驗收用',15),(4,'2023-05-07 11:23:51',NULL,3,'E22082','國教院-貽婷','國教院-貽婷',15),(5,'2023-05-10 11:27:00',NULL,4,'E22082','國教院-貽婷','國教院-貽婷',15),(6,'2023-05-10 11:27:20',NULL,5,'E22082','國教院-貽婷','國教院-貽婷',15),(7,'2023-05-10 11:23:51',NULL,6,'E22082','客戶需求','客戶需求',15),(8,'2023-05-10 11:23:51',NULL,7,'E22082','客戶需求','客戶需求',15),(9,'2023-05-22 08:17:57',NULL,8,'R22018','2023年5月預試','2023年5月預試',15),(10,'2023-05-22 08:18:18',NULL,8,'R22019','2023年5月預試','2023年5月預試',15),(11,'2023-05-22 08:50:14',NULL,9,'R22018','2023年5月預試','2023年5月預試',15),(12,'2023-05-22 08:50:33',NULL,9,'R22019','2023年5月預試','2023年5月預試',15),(13,'2023-05-28 16:17:57',NULL,10,'R22018','2023年5月預試','2023年5月預試',15),(14,'2023-05-28 16:18:08',NULL,10,'R22019','2023年5月預試','2023年5月預試',15),(15,'2023-05-28 16:18:46',NULL,11,'R22018','2023年5月預試','2023年5月預試',15),(16,'2023-05-28 16:18:56',NULL,11,'R22019','2023年5月預試','2023年5月預試',15),(17,'2023-05-28 16:19:15',NULL,12,'R22018','2023年5月預試','2023年5月預試',15),(18,'2023-05-28 16:19:23',NULL,12,'R22019','2023年5月預試','2023年5月預試',15),(19,'2023-06-07 12:38:17',NULL,13,'R22018','2023年5月預試','2023年5月預試',15),(20,'2023-06-07 12:38:29',NULL,13,'R22019','2023年5月預試','2023年5月預試',15),(900,'2022-09-13 14:39:26','2022-10-12 13:29:31',999,'R22018','題組一','Person A',15),(901,NULL,'2022-10-11 00:37:36',999,'R22019','題組二','Online shopping',15),(902,'2022-10-08 14:39:16','2022-10-11 00:37:41',999,'E22077','字典模組測試題','Later Is Better!\n\nDo you feel it\'s hard to get up early for school and even harder to listen well in the first class at 8 a.m.? Well, this happens to most of us and is not helpful for our learning!\n\nSome studies show that teenagers’ brains make melatonin, the hormone that helps sleep, between 11 p.m. and 8 a.m. So it’s better for us to sleep during these nine hours. But here comes the problem. We’re asked to get to school by 7:30 a.m. That means we have to get up before 7, when our brains should still be sleeping. That’s why we’re always so tired and can’t think clearly in early morning classes. No clear head, no good learning, right?\n\nIf we can’t change how our body works, why can’t school start later? In this way, we can not only sleep more but also learn better!',15),(903,'2023-04-24 07:09:31',NULL,999,'R23023','拍影片用','20230424拍影片用',15);
