  `word` varchar(255) DEFAULT NULL COMMENT '英文單字',
  `word_frequency_source_01` varchar(255) DEFAULT NULL COMMENT '詞頻來源01',
  `word_frequency_source_02` varchar(255) DEFAULT NULL COMMENT '詞頻來源02',
